import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Grid from '@material-ui/core/Grid';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import {Redirect} from "react-router-dom";
import auth from '../components/auth'


const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
    },
    menuButton: {
        marginRight: theme.spacing(2),
    },
    titleT: {
        flexGrow: 1,
    },
    paper: {
        padding: theme.spacing(1),
        textAlign: 'center',
        color: theme.palette.text.secondary,
    },
    bullet: {
        display: 'inline-block',
        margin: '0 2px',
        transform: 'scale(0.8)',
    },
    title: {
        fontSize: 14,
    },
    pos: {
        marginBottom: 12,
    },
}));

const ProjectPage =(props)=>{

    const classes = useStyles();

    const bull = <span className={classes.bullet}>â€¢</span>;


    function FormRow() {
        return (
            <React.Fragment>
                <Grid item xs={4}>
                    <Card className={classes.bullet} >
                        <CardContent>
                            <Typography className={classes.title} color="textSecondary" gutterBottom>
                                Full stack web-app
                            </Typography>
                            <Typography variant="h5" component="h2">
                                Information sharing app
                            </Typography>
                            <Typography className={classes.pos} color="textSecondary">
                                Spring boot,React js,Redox, Axios
                            </Typography>
                            <Typography variant="body2" component="p">
                                It is a simple social media web-app.
                                <br />
                                People can login,logout,sign up, and
                                <br/>
                                preform CRUD operation.
                            </Typography>
                        </CardContent>
                        <CardActions>
                            <Button size="small" onClick={()=><Redirect to={"https://github.com/CoderEthio/School-Project-AssembleyLanguage-86xProcesses-TicTocToe-Game"}/>}>see code on github</Button>
                        </CardActions>
                    </Card>
                </Grid>
                <Grid item xs={4}>
                    <Card className={classes.bullet} >
                        <CardContent>
                            <Typography className={classes.title} color="textSecondary" gutterBottom>
                                Word of the Day
                            </Typography>
                            <Typography variant="h5" component="h2">
                                be{bull}nev{bull}o{bull}lent
                            </Typography>
                            <Typography className={classes.pos} color="textSecondary">
                                adjective
                            </Typography>
                            <Typography variant="body2" component="p">
                                well meaning and kindly.
                                <br />
                                {'"a benevolent smile"'}
                            </Typography>
                        </CardContent>
                        <CardActions>
                            <Button size="small">Learn More</Button>
                        </CardActions>
                    </Card>
                </Grid>
                <Grid item xs={4}>
                    <Card className={classes.bullet} >
                        <CardContent>
                            <Typography className={classes.title} color="textSecondary" gutterBottom>
                                Word of the Day
                            </Typography>
                            <Typography variant="h5" component="h2">
                                be{bull}nev{bull}o{bull}lent
                            </Typography>
                            <Typography className={classes.pos} color="textSecondary">
                                adjective
                            </Typography>
                            <Typography variant="body2" component="p">
                                well meaning and kindly.
                                <br />
                                {'"a benevolent smile"'}
                            </Typography>
                        </CardContent>
                        <CardActions>
                            <Button size="small">Learn More</Button>
                        </CardActions>
                    </Card>
                </Grid>
            </React.Fragment>
        );
    }


    return (
        <div>
            <AppBar position="static" color={'transparent'}>
                <Toolbar>
                    <IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu">
                    <a href={'https://www.linkedin.com/in/aklom-desta50'}><LinkedInIcon color="primary"  fontSize="large"/> </a>

                    </IconButton>
                    <Typography variant="h6" className={classes.titleT}>
                    </Typography>
                    <Button  color="inherit" onClick={()=>{
                        auth.logout(()=>{
                            props.history.push("/")
                        })
                    }}>Logout</Button>
                </Toolbar>
            </AppBar>
            <Grid container spacing={1}>
                <Grid container item xs={12} spacing={3}>
                    <FormRow />
                </Grid>
            </Grid>


        </div>
    )
}
export default ProjectPage;
